import React from 'react';
import './Card.css';
import StarIcon from '@material-ui/icons/Star';
import StarBorderIcon from '@material-ui/icons/StarBorder';
import MoreIcon from '@material-ui/icons/More';

const Card = ({src, name, address, details, offers, price}) => {
    return (
        <div className='card'>
        
            <img src={src} alt="" />
            <button  className="btn">Best college 2018</button>
             <button  className="btn btns">2kms away</button>
            
            <div className="info">
            <div className="card__info">
                <h2>{name}<StarIcon /><StarIcon /><StarIcon /><StarIcon /><StarBorderIcon /></h2>
                 <h4>{address}</h4>
                 <h4>{details}</h4>
                 <h4>{offers}</h4>
                 <h4>{price}</h4>
              </div>   
            <div className="side__info">
            <MoreIcon />
            </div>
            </div>

            
        </div>
    )
}

export default Card
